        } else if ((row[curr_month_year] ?? 0) < (row[prev_month_year] ?? 0)) {
          stats.contractionArr[curr_month_year] +=
            row[prev_month_year] - (row[curr_month_year] ?? 0);
        }
      });

    stats.openingArr[curr_month_year] = stats.netClosingArr[prev_month_year];
    stats.newArr[curr_month_year] = stats.newArr[curr_month_year] * 12;
    stats.churnedArr[curr_month_year] = stats.churnedArr[curr_month_year] * 12;

    stats.expansionArr[curr_month_year] =
      stats.expansionArr[curr_month_year] * 12 - stats.newArr[curr_month_year];

    stats.contractionArr[curr_month_year] = Math.abs(
      stats.contractionArr[curr_month_year] * 12 -
        stats.churnedArr[curr_month_year]
    );

    stats.netClosingArr[curr_month_year] =
      stats.openingArr[curr_month_year] +
      (stats.newArr[curr_month_year] +
        (stats.expansionArr[curr_month_year] -
          stats.contractionArr[curr_month_year]) -
        stats.churnedArr[curr_month_year]);
  }
});

return stats;
